After an unexpected accident, distraught Tsubaki Tsukishiro is left in denial of his sister's death. But after a moment of despair, he has an epiphany,&quot;I don't need to exist if my sister is here.&quot;

Donning his sister's clothes, he ventures out with the resolve to erase the existence of &quot;Tsubaki&quot; in favor of reviving &quot;Chika&quot;. But while passing through the streets the day of her funeral, a man calls out to him with a single word,&quot;Chika?&quot;

A short story about two men desperately clinging onto the image of someone they so dearly love.

Note: This is not Shounen Ai. This is about a budding friendship born from two people dealing with a common loss.

